import React, { Component } from 'react'
import './App.css';

const App = () => {
  return (
    <div><Header />
      <div className="App">
        <ul>
          <li>html</li>
          <li>css</li>
          <li>js</li>
          <li>react</li>
        </ul>
      </div>
    </div>
  );
}

const Header = () => {
  return (
    <div>
      <a href="">1</a>
      <a href="">2</a>
      <a href="">3</a>
      <a href="">4</a>
      <a href="">5</a>
    </div>

  );
}

export default App;
